CREATE DATABASE /*!32312 IF NOT EXISTS*/`szok` /*!40100 DEFAULT CHARACTER SET latin1 */;

DROP VIEW IF exists avaliableConferences;
CREATE VIEW avaliableConferences AS 
	select * from conferences c 
    where startDate > now(); 
    
  select conferenceID, count(partcipantsID)from conferenceMembers
  group by conferenceID;
  
DROP VIEW IF exists avaliableConferences;
CREATE VIEW avaliableConferences AS 
  
  WITH registeredUsers AS(
  select conferenceID, count(partcipantsID) cnt from conferenceMembers
  group by conferenceID)
  
  select c.*, reg.cnt from conferences c
  inner join registeredUsers reg
  on reg.conferenceID = c.ID
  where c.startDate > now() 
  and c.quantityLimit > reg.cnt;
  
  select * from avaliableconferences;
  

create table `conferences_history` (
	`historyID` int(11) auto_increment NOT NULL,
    `action` varchar(50) NOT NULL,
	`ID` int(11) NOT NULL,
	`name` varchar(50) NOT NULL,
    `place` varchar(50) NOT NULL,
    `startDate` datetime NOT NULL,
	`endDate` datetime NOT NULL,
    `quantityLimit` int(11),
    primary key (`historyID`));
    
DROP TRIGGER `conferences_after_insert`;
    
  DELIMITER //
CREATE TRIGGER `conferences_after_insert` AFTER INSERT ON `conferences`
FOR EACH ROW
BEGIN
	VALUES('insert',NEW.`ID`, NEW.`name`,NEW.`place`,NEW.`startDate`,NEW.`endDate`,NEW.`quantityLimit`);
END //

DELIMITER ;


DROP TRIGGER `conferenceMembers_before_insert`;
DELIMITER //
CREATE TRIGGER `conferenceMembers_before_insert` BEFORE INSERT ON `conferencemembers`
FOR EACH ROW
BEGIN 
	DECLARE `count_check` int;
    select count(*) from avaliableconferences where ID = NEW.`conferenceID` into `count_check`;
	IF `count_check` = 0 then
		SIGNAL SQLSTATE '45000'
		SET MESSAGE_TEXT = 'We reached the limit of participants on this conference';
    END IF;    
END //
DELIMITER ;
  
  
  DROP PROCEDURE IF EXISTS addConferenceMember;

DELIMITER //
CREATE PROCEDURE addConferenceMember(
		IN conferenceID int(11),
		IN userID int(11),
        IN orderID int(11))
        
BEGIN
	DECLARE quantityLimit smallint(6);
    DECLARE avaliableSpotsParam int(11);
    SELECT avaliableSpots from conferences where ID = conferenceID
    into avaliableSpotsParam;
    
    IF avaliableSpotsParam = 0 THEN
		SIGNAL SQLSTATE '45000'
		SET MESSAGE_TEXT = 'there`s no spots in conference!';
    END IF;
    
    VALUES (userID , conferenceID, orderID, payed);
    
    UPDATE `conferences` SET `avaliableSpots` = avaliableSpotsParam - 1
    WHERE ID = conferenceID;
    
END //
DELIMITER ;

