USE `szok`;

-- TABELA KONFERENCJI
DROP TABLE IF EXISTS `conferences`;
create table `conferences` (
	`ID` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
	`name` varchar(50) NOT NULL,
    `place` varchar(50) NOT NULL,
    `startDate` datetime NOT NULL,
	`endDate` datetime NOT NULL,
    `quantityLimit` int(11),
    `avaliableSpots` int(11)
    );
  

-- TABELA WARSZTATÓW
DROP TABLE IF EXISTS `workshops`;
CREATE TABLE `workshops` (
	`ID` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
	`worksopName` varchar(50) NOT NULL,
	`conferenceID` int(11) UNSIGNED,
    `workshopCapacity`int(10) NOT NULL,
    `workshopPrice` int(10) NOT NULL,
    `startTime` datetime NOT NULL,
    `endTime` datetime NOT NULL,
    `prelegentID` int(11) UNSIGNED,
	CONSTRAINT `confId_ibfk_1` FOREIGN KEY (`conferenceID`) REFERENCES `conferences` (`ID`),
	CONSTRAINT `prelegentID_ibfk_2` FOREIGN KEY (`prelegentID`) REFERENCES `prelegents` (`ID`)
    );
    
    
-- TABELA PRELEKCJI
DROP TABLE IF EXISTS `lectures`;
CREATE TABLE `lectures` (
`ID` int(11) UNSIGNED auto_increment primary key,
`name` varchar(50) not null,
`conferenceID` int(11) UNSIGNED,
`prelegentID` int(11) UNSIGNED,
`startTime` datetime not null,
`endTime` datetime not null,
CONSTRAINT `lectures_prelegents_fk` FOREIGN KEY (`prelegentID`) REFERENCES `prelegents` (`ID`), 	
CONSTRAINT `lectures_conferences_fk` FOREIGN KEY (`conferenceID`) REFERENCES `conferences` (`ID`) ) ;


-- TABELA PRELEGENTÓW
DROP TABLE IF EXISTS `prelegents`;
CREATE TABLE `prelegents` (
`ID` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
`firstName` varchar(50) NOT NULL,
`secondName` varchar(50) NOT NULL,
`cost` decimal(10,2) NOT NULL);



-- TABELA KLIENTÓW
DROP TABLE IF EXISTS `clients`;
CREATE TABLE `clients` (
  `ID` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
  `name` varchar(50) NOT NULL,
  `discount` int(11) default 0
);


-- TABELA UCZESTNIKÓW
DROP TABLE IF EXISTS `participants`;
CREATE TABLE `participants`(
`ID` int(11) unsigned auto_increment primary key,
`clientID` int(11) UNSIGNED,
`firstName` varchar(50) not null,
`secondName` varchar(50) not null,
CONSTRAINT `participants_clients_fk` FOREIGN KEY (`clientID`) REFERENCES `clients` (`ID`)); 



-- TABELA UCZESNITKÓW KONFERENCJI
DROP TABLE IF EXISTS `conferenceMembers`;
CREATE TABLE `conferenceMembers` (
  `ID` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
  `partcipantsID` int(11) UNSIGNED,
  `conferenceID` int(11) UNSIGNED,
  `orderID` int(11) UNSIGNED,
  `payed` boolean default 0 NOT NULL,
  CONSTRAINT `confMembers_partcipants_fk` FOREIGN KEY (`partcipantsID`) REFERENCES `participants` (`ID`),
CONSTRAINT `confMembers_conference_fk` FOREIGN KEY (`conferenceID`) REFERENCES `conferences` (`ID`),
CONSTRAINT `confMembers_order_fk` FOREIGN KEY (`orderID`) REFERENCES `orders` (`ID`)
    ); 

-- TABELA UCZESTNIKÓW WARSZTATÓW
DROP TABLE IF EXISTS `workshopMembers`;
CREATE TABLE `workshopMembers` (
  `ID` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
  `participantsID` int(11) UNSIGNED,
  `workshopID` int(11) UNSIGNED,
  `orderID` int(11) UNSIGNED,
  `payed` boolean default 0 NOT NULL,  
  CONSTRAINT `workshopMember_participants_fk` FOREIGN KEY (`participantsID`) REFERENCES `participants` (`ID`),
  CONSTRAINT `workshopMembers_workshop_fk` FOREIGN KEY (`workshopID`) REFERENCES `workshops` (`ID`),
CONSTRAINT `workshopfMembers_order_fk` FOREIGN KEY (`orderID`) REFERENCES `orders` (`ID`));




-- TABELA ZAMÓWIEŃ
drop table if exists `orders`;
create table `orders` (
	`ID` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
    `orderDate` datetime NOT NULL,
    `expireDate` datetime NOT NULL,
    `paymentDate` datetime,
    `value` decimal(10, 2) NOT NULL,
    `clientID` int(11) UNSIGNED,
    KEY `clientID` (`clientID`),
    CONSTRAINT `client_orders_ibfk` FOREIGN KEY (`clientID`) REFERENCES `clients` (`ID`)
    );
    
-- TABELA PŁATNOŚCI
DROP TABLE IF EXISTS `payments`;
CREATE TABLE `payments` (
	`paymentId` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
	`orderId`int(11) UNSIGNED,
    `paymentDate` date NOT NULL,
    `value` decimal(10,2) NOT NULL,
    CONSTRAINT `payment_orders_fk` FOREIGN KEY (`orderId`) REFERENCES `orders` (`ID`)
    );
    
-- TABELA CEN
DROP TABLE IF EXISTS `prices`;
create table `prices` (
	`ID` int(11) UNSIGNED AUTO_INCREMENT PRIMARY KEY,
    `value` decimal(10,2) NOT NULL,
    `validFrom` datetime NOT NULL,
    `validTo` datetime NOT NULL,
    `conferenceID` int(11) UNSIGNED,
	KEY `conferenceID` (`conferenceID`),
	CONSTRAINT `prices_conferences_ibfk` FOREIGN KEY (`conferenceID`) REFERENCES `conferences` (`ID`)
    );
    


